import {
    Box,
    Heading,
    AspectRatio,
    Image,
    Text,
    Center,
    HStack,
    Stack,
  } from "native-base";

import React from "react";
import {  StyleSheet, View } from "react-native";
import { baseURL } from "../../store/instance";

const ProfileItem = ({ profile, navigation }) => {
  return (
    <View>
      <Text>checking</Text>

      <Text>{profile.name}</Text>
      <Image source></Image>
      <Pressable
        onPress={() => {
          navigation.navigate("ProfileDetail", { profile: profile });
          console.log("click");
        }}
      >
        <Box>
          <AspectRatio w="100%" ratio={16 / 9}>
            <Image source={{ uri: baseURL + profile.image }} alt="image" />
          </AspectRatio>
          <Center
            bg="#0000ff"
            _dark={{
              bg: "violet.400",
            }}
            _text={{
              color: "#f8f8ff",
              fontWeight: "700",
              fontSize: "xs",
            }}
            position="absolute"
            bottom="0"
            px="3"
            py="1.5"
          >
            {profile.name}
          </Center>
        </Box>
      </Pressable>

    </View>
  );
};

export default ProfileItem;

const styles = StyleSheet.create({});
